void displayTask(void *p)
{
  preferences.begin(PREFERENCES_NAME, false); 
  initDisplay(3);
  fillSyncAxisItems();
  page.currentPage = 1;
  page.pageCount = 3;
  display->drawRGBBitmap(0,0,image_data_11111111111111111,320,240);
  vTaskDelay(3000);
  while (true)
  {
    switch (page.currentPage)
    {
    case 1: // main page
    {
      if (!page.isInit)
      {
        page.isInit = true;
        vTaskDelay(100);
        drawMainTheme();
        vTaskDelay(100);
        
      }
      else
      {
        refresh();
      }
      vTaskDelay(100);
      break;
    }
    case 2: // SD page
    {
      if (!page.isInit)
      {
        drawSDTheme();
        SDCard.items.clear();
        page.isInit = true;
      }
      if (!SDCard.isMenuCreated)
      {
        if (SDCard.refresh)
        {
          SDCard.isMenuCreated = true;
          page.currentItem = 0;
          createMenuItems();
        }
      }
      if (page.itemChanged)
      {
        page.itemChanged = false;
        refreshMenuCurser();
      }
      vTaskDelay(50);
      break;
    }
    case 3: //Sync Axis
    {
      if (!page.isInit)
      {
        drawSyncTheme();
        page.isInit = true;
      }
      if (SyncAxis.isMenuCreated)
      {
        if (page.itemChanged)
        {
          page.itemChanged = false;
          refreshMenuCurser();
        }
      }
      vTaskDelay(50);
      break;
    }
    default:
      break;
    }
  }
}

void displaySetup(void)
{
  xTaskCreate(displayTask, "displayTask", 10 * 1024, NULL, 500, NULL);
}